import React, { useState } from 'react';

const Projects = () => {
  const [activeTab, setActiveTab] = useState('completed');

  const completedProjects = [
    'Modern Office Complex - Downtown',
    'Luxury Residential Towers - Riverside',
    'Shopping Mall Renovation',
    'Industrial Warehouse Facility'
  ];

  const ongoingProjects = [
    'Tech Park Development - Phase 2',
    'Hospital Extension Project',
    'Smart City Residential Project',
    'Commercial Plaza Construction'
  ];

  return (
    <div className="container">
      <section className="page-section">
        <h1 className="section-title">Our Projects</h1>
        
        <div style={{ marginBottom: '2rem', textAlign: 'center' }}>
          <button 
            onClick={() => setActiveTab('completed')}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              backgroundColor: activeTab === 'completed' ? '#007bff' : '#f8f9fa',
              color: activeTab === 'completed' ? 'white' : '#333',
              border: '1px solid #ddd',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            Completed Projects
          </button>
          <button 
            onClick={() => setActiveTab('ongoing')}
            style={{
              padding: '10px 20px',
              margin: '0 10px',
              backgroundColor: activeTab === 'ongoing' ? '#007bff' : '#f8f9fa',
              color: activeTab === 'ongoing' ? 'white' : '#333',
              border: '1px solid #ddd',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            Ongoing Projects
          </button>
        </div>

        <div className="section-content">
          {activeTab === 'completed' && (
            <div>
              <h3>Completed Projects</h3>
              <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
                {completedProjects.map((project, index) => (
                  <li key={index} style={{ marginBottom: '0.5rem' }}>{project}</li>
                ))}
              </ul>
            </div>
          )}
          
          {activeTab === 'ongoing' && (
            <div>
              <h3>Ongoing Projects</h3>
              <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
                {ongoingProjects.map((project, index) => (
                  <li key={index} style={{ marginBottom: '0.5rem' }}>{project}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      </section>
    </div>
  );
};

export default Projects;
